CREATE TABLE IF NOT EXISTS "メンバー履歴" (
    "UUIDv4" VARCHAR(36) NOT NULL,
    "user_id" VARCHAR(32) NOT NULL,
    "家門名" VARCHAR(45) NOT NULL,
    "戦闘力" INT NOT NULL,
    "職マスタ_職名" VARCHAR(50) NOT NULL,
    "created_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
    PRIMARY KEY ("UUIDv4"),
    CONSTRAINT "fk_メンバー履歴_職マスタ1"
        FOREIGN KEY ("職マスタ_職名")
            REFERENCES "職マスタ" ("職名")
            ON DELETE NO ACTION
            ON UPDATE NO ACTION);


CREATE TABLE IF NOT EXISTS "メンバー" (
    "user_id" VARCHAR(32) NOT NULL,
    "メンバー履歴_UUIDv4" VARCHAR(36) NOT NULL,
    PRIMARY KEY ("user_id"),
    CONSTRAINT "fk_メンバー_メンバー履歴"
        FOREIGN KEY ("メンバー履歴_UUIDv4")
            REFERENCES "メンバー履歴" ("UUIDv4")
            ON DELETE NO ACTION
            ON UPDATE NO ACTION);

